import React, { useState } from 'react';

export default function Form() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [fullName, setFullName] = useState(''); // Pre-compute fullName

  const handleFirstNameChange = (e) => {
    setFirstName(e.target.value);
    setFullName(`${e.target.value} ${lastName}`); // Update fullName on change
  };

  const handleLastNameChange = (e) => {
    setLastName(e.target.value);
    setFullName(`${firstName} ${e.target.value}`); // Update fullName on change
  };

  return (
    <>
      <h2>Sign Up</h2>
      <form action="" className="form">
        <label htmlFor="firstName">First Name:</label>
        <input
          type="text"
          id="firstName"
          value={firstName}
          onChange={handleFirstNameChange}
        />

        <label htmlFor="lastName">Last Name:</label>
        <input
          type="text"
          id="lastName"
          value={lastName}
          onChange={handleLastNameChange}
        />

        <button type="submit">Submit</button>
      </form>

      <p>Welcome: <strong>{fullName}</strong></p>
    </>
  );
}
